import Header from "./../header/Header";
import RegionTop from "./../regiontop/RegionTop";
import RegionBottom from "./../regionbottom/RegionBottom";
import Footer from "./../footer/Footer";

function Catalog() {



  const handleClick = (id) => {

    let cartIds = JSON.parse(sessionStorage.getItem('cartIds')) || [];
    if (!cartIds.includes(id)) {
        cartIds.push(id);
        sessionStorage.setItem('cartIds', JSON.stringify(cartIds));
    }
}









  return (
    <div className="Catalog"> 
        <Header handleClick={handleClick} />
        <RegionTop handleClick={handleClick} />
        <RegionBottom />
        <Footer />
    </div>
  );
}

export default Catalog;
